// ProductPage page components
import ProductCell from "layouts/ecommerce/products/product-page/components/ProductCell";

// Images
const chairWood =
  "https://raw.githubusercontent.com/creativetimofficial/public-assets/master/soft-ui-design-system/assets/img/ecommerce/chair-wood.jpg";

export default {
  columns: [
    { Header: "Investor Name", accessor: "product", width: "50%" },
    { Header: "BSE UCC", accessor: "bse", width: "10%" },
    { Header: "PAN No", accessor: "pan", align: "center" },
    { Header: "Total Amount", accessor: "rs", align: "center", width: "40%" },
  ],

  rows: [
    {
      product: <ProductCell image={chairWood} name="Anukriti Bhattad" />,
      bse: "A1820",
      pan: "CKSPB1846H",
      availability: "	12,499",
    },
  ],
};
